import React from 'react';
const about_image = `${process.env.PUBLIC_URL}/img/thapcam.png`

function AboutUs(props) {
    return (
        <div className='AboutUs'>
            <h2 className='AboutUs-Title'>
                ABOUT US
            </h2>
            <div className='AboutUs-Content'>
                <img className='AboutUs-Image' url={about_image} alt='anh mo ta' width='300px' height='400px' backgroundSize='cover' />
            </div>
        </div>
    );
}

export default AboutUs;
